// ComponentC.js
import React from 'react';

const ComponentC = ({ inputValue, handleInputChange, handleSubmit }) => {
  return (
    <div>
      <h2>Component C</h2>
      <form onSubmit={handleSubmit}>
        <input 
          type="text"
          value={inputValue}
          onChange={handleInputChange}
        />
        <button type="submit">Spara</button>
      </form>
    </div>
  );
}

export default ComponentC;
